import "./rating.css"
function Rating(){
    return(
        <div className="main-rating">
        <div className="rating">
            <a className="rating-link first-link" href="/about">About</a>
            <h2 className="rating-head">SIGDI</h2>
            <a className="rating-link" href="/contact">Contact</a>
        </div>
    </div>
    )
}
export default Rating;
